import Layout from '../components/layout';
import Link from 'next/link';

const PostLink = props => (
  <li>
    <Link href={'/post?title=${props.title}'}>
      <a>{props.title}</a>
    </Link>
  </li>
);

export default function Blog() {
  return (
      <Layout>
        <h1>Lake Consulting Blog</h1>
        <ul>
          <PostLink title="How it all started..."/>
          <PostLink title="My first five years in Sales"/>
          <PostLink title="Why salesman learned to write code?"/>
        </ul>
      </Layout>
  );
}
